        TypeSerializer<?>[] registeredSubclassSerializers,
        Field[] fields,
        TypeSerializer<?>[] fieldSerializers,
        Map<Class<?>, TypeSerializer<?>> nonRegisteredSubclassSerializerCache) {

    final LinkedHashMap<Class<?>, TypeSerializer<?>> subclassRegistry =
