        } else {
            Lockable<SharedBufferNode> lockableFromState = entries.get(nodeId);
            if (Objects.nonNull(lockableFromState)) {
                entryCache.put(nodeId, lockableFromState);
            }
            return lockableFromState;
        }
    } catch (Exception ex) {
        throw new WrappingRuntimeException(ex);
    }
}

