        return userProvidedType;
    } else if (scalaType != null) {
        return scalaType;
    } else {
        return TypeExtractor.createTypeInfo(
                aggregateFunction,
                ImperativeAggregateFunction.class,
                aggregateFunction.getClass(),
                1);
    }
