    Map<JobVertexID, BitSet> runningStatusByVertex = new HashMap<>();

    for (ExecutionJobVertex vertex : jobVerticesInTopologyOrder) {
        BitSet runningTasks = new BitSet(vertex.getTaskVertices().length);

