    byteOffset += shouldSkipByte(byteOffset + 1) ? 2 : 1;
  }
  returnValue |= (data[byteOffset] & 0xFF) >> (8 - bitOffset);
  returnValue &= 0xFFFFFFFF >>> (32 - numBits);
  if (bitOffset == 8) {
    bitOffset = 0;
    byteOffset += shouldSkipByte(byteOffset + 1) ? 2 : 1;
  }
  assertValidOffset();
  return returnValue;
}

