  return new Format.Builder()
      .setId(trackId)
      .setSampleMimeType(MimeTypes.AUDIO_AC3)
      .setChannelCount(channelCount)
      .setSampleRate(sampleRate)
      .setDrmInitData(drmInitData)
      .setLanguage(language)
      .build();
}

