      currentItemId,
      mediaItem != null ? mediaItem : MediaItem.EMPTY,
      mediaStatus.getMediaInfo(),
      currentContentId,
       C.TIME_UNSET);

  for (MediaQueueItem queueItem : mediaStatus.getQueueItems()) {
    long defaultPositionUs = (long) (queueItem.getStartTime() * C.MICROS_PER_SECOND);
