		else {
			writeMessage(msg);
		}

		return EVAL_PAGE;
	}
	catch (IOException ex) {
		throw new JspTagException(ex.getMessage(), ex);
	}
	catch (NoSuchMessageException ex) {
		throw new JspTagException(getNoSuchMessageExceptionDescription(ex));
