private UserDetailsService getUserDetailsService() {
	Map<String, ?> beans = getBeansOfType(CachingUserDetailsService.class);
	if (beans.size() == 0) {
		beans = getBeansOfType(UserDetailsService.class);
	}
	if (beans.size() == 0) {
